import React from "react";

const App = () => {
  return (
    <div>
      <h2>Album</h2>
      <form>
        <label htmlFor="image">photo</label>
        <input id="image" type="file"></input>
        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default App;
